import React from 'react';
import HomeHeader from '../../components/Header';
import ScrollServices from '../../components/ScrollServices';
import SessionOne from './SessionOne';
import { Container } from './styles';

const Home: React.FC = () => {
  return (
    <Container>
      <HomeHeader />
      <ScrollServices />
      <SessionOne />
    </Container>
  );
};

export default Home;
